const React=require('react');

class Hello extends React.Component {
	render() {
		return (
			<html>
				<body>
					<h1> Hello Full Stack - Arwa </h1>
					<script src='/scripts/script.js'></script>
				</body>
			</html>

			)
	}
}

module.exports=Hello;

